def safe_execute_command(command):
    """Safely execute a shell command with input validation"""
    # Validate command doesn't contain dangerous patterns
    dangerous_patterns = [';', '&', '|', '||', '&&', '$(', '`']
    for pattern in dangerous_patterns:
        if pattern in command:
            raise ValueError(f"Command contains dangerous pattern: {pattern}")

    return {"command": f"execute_shell('{command}')"}

